// App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useLocation } from 'react-router-dom';
import Draw from "/Users/gizem/Desktop/reactproje/src/common/drawer.js";
import Home from './views/home';
import Task from './components/task';
import Calend from './components/calendar';
import { MailOutlined, SettingOutlined, FileTextOutlined, CalendarOutlined, FileAddOutlined } from '@ant-design/icons';
import Login from './components/login';

// Define itemsList here
const itemsList = [
  {
    label: "Görevler",
    key: 'task',
    icon: <FileTextOutlined />,
    route: '/task',
  },
  {
    label: "Görev Ekle",
    key: 'task2',
    icon: <FileAddOutlined />,
    route: '/add-task',
  },
  {
    label: "Takvim",
    key: 'calendar',
    icon: <CalendarOutlined />,
    route: '/calendar',
  },
  {
    label: 'Mail',
    key: 'mail',
    icon: <MailOutlined />,
    route: '/mail',
  },
  {
    label: 'Profil Düzenle',
    key: 'setting:1',
    icon: <SettingOutlined />,
    route: '/edit-profile',
  }
];

function App() {
  const { state } = useLocation();
  const userData = state?.userData;

  return (
    <Router>
      <div className="App">


        <Routes>
          <Route path="/" element={<Login/>} />
          <Route path="/home" element={<Home itemsList={itemsList} />} />
          <Route path="/task" element={<Task />} />

          {/* Diğer sayfalar için Route tanımlamaları */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
